import Logo from '../Images/Logo.png';
function HomePage() {
	return (
		<div class='container border border-danger d-flex flex-row '>
			<div class='p-3 d-inline-flex border'>
				<h1>MeowMeow</h1>
			</div>
			<button class='dropbtn'>Dropdown</button>
			<div class='dropdown-content'>
				<a href='#'>Link 1</a>
				<a href='#'>Link 2</a>
				<a href='#'>Link 3</a>
			</div>
			<div class='p-3 d-inline-flex border mt-3 mb-2'>
				<h4>MeowMeow</h4>
			</div>
			<div class='p-3 d-inline-flex border mt-3 mb-2'>
				<h4>MeowMeow</h4>
			</div>
			<div class='p-3 d-inline-flex border mt-3 mb-2'>
				<h4>MeowMeow</h4>
			</div>
			<div class='p-3 d-inline-flex border mt-3 mb-2'>
				<input class='form-control me-2' type='text' placeholder='Search' />
			</div>
		</div>
	);
}

export default HomePage;
